import React from 'react';
import Filters from './components/Filters.js'
import './Style.css';



function gallery() {
    return (
    <div class="container">
        <div class="row">
                <div class="col-3">
                    <Filters/>{}
                </div> 
            <div class="col"><button className='btn btn-light'>COl2</button></div> 
            <div class="col"><button className='btn btn-light'>COl3</button></div> 
        </div>
    </div>
    );
  }
  
  export default gallery;
